import React from "react";

const MySelect = ({options, defaultValue}) => {
  return (
    <select>
      <option disabled={true} value1="value1">{defaultValue}</option>
      {options.map(option =>
        <option 
        value={option.value}
        key={option.value}
        >
        {option.name}
        </option>
      )}
    </select>
  );
};

export default MySelect;
